import './App.css';
import Dog from './Dog'



class App extends React.Component {

  render() {

    return (
      <div className="App" >
        <div id="filter-div">
          <button id="good-dog-filter">Filter good dogs: OFF</button>
        </div>
        <div id="dog-bar">
          <Dog allPups={this.allPups} />
        </div>
        <div id="dog-summary-container">
          <h1>DOGGO:</h1>
          <div id="dog-info">

          </div>
        </div>
      </div>
    );
  }
}

export default App;
